import React from 'react';
import FilterWithCategoriesMen from './filterItems/FilterWithCategoriesMen';
import MenProducts from './MenProducts';


const Container = styled.div`
    border: 2px solid teal;
`;

const Men = () => {
  return (
    <Container>
        <FilterWithCategoriesMen />
        <MenProducts />
    </Container>
  )
}

export default Men
